import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { CookieProvider } from "./components/AuthContext";

ReactDOM.render(
    <React.StrictMode>
      <CookieProvider>
        <App />
      </CookieProvider>
    </React.StrictMode>,
    document.getElementById('root')
  );
